INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '92', '92', 'und', '0', 'L appartement bénéficie d’un emplacement privilégié dans un quartier calme de marrakech, juste en face de l’hypermarché marjane de route de casa , situé au deuxième étage et d’une surface de 55 m2, cet appartement dispose de 1 chambre á coucher  et 2 confortables salons  pouvant ainsi héberger jusqu’à 5 personnes, tv avec lecteur dvd, et chaines étrangéres, cuisine et salle de bain bien équipées, chauffage et climatisation.\r\n15 minutes de promenade vous conduiront jusqu’à la médina, où vous pourrez vous plonger dans l’animation et l’atmosphère unique de ce quartier rempli de souks et d’impressionnants monuments. cet appartement est bien desservi par les transports publics avec un arrêt de bus à marjane et une station de taxis à 50 mètres seulement. la gare de marrakech es á 1Km de l appartement. 350 la nuit et minimum 3 nuits', null);
