INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '94', '94', 'und', '0', 'L appartement bénéficie d’un emplacement privilégié dans un quartier commerçant de marrakech,juste en face de l’hypermarché marjane de route de casa et d’autres magasins et restaurants. situé au deuxième étage et d’une surface de 55 m2, cet appartement dispose de 2 chambres á coucher et 1 confortable salon  pouvant ainsi héberger jusqu’à 5 personnes, tv avec lecteur dvd, cuisine, salle de bain, chauffage et climatisation.\r\n15 minutes de promenade vous conduiront jusqu’à la médina, où vous pourrez vous plonger dans l’animation et l’atmosphère unique de ce quartier rempli de souks et d’impressionnants monuments. cet appartement est bien desservi par les transports publics avec un arrêt de bus à marjane et une station de taxis à 50 mètres seulement. la gare de marrakech est à 1 km.\r\n350  la nuit  et minimum 3 nuits.', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '95', '95', 'und', '0', 'il y a une chambre adulte, une chambre enfant avec 2 lit, une cuisine équipée (four, cafetière, frigot,..), un grand salon avec écran plat + climatisation, une salle à manger avec table et chaise, toilette et douche. appartement propre, belle déco moderne. machine a laver et aspirateur il est au premier étage. il est situé vers le grand marjane et la zone commerciale. si vous êtes intéressés, n\'hésitez pas à me contacter pour plus de renseignement. pour les familles ou couple mariés possibilité de louer pour petite période 350dh la nuit 2100dh la semaine prix dégressif pour durée plus longue tel : 06 49 08 71 34', null);
