INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '103', '103', 'und', '0', 'Très spacieuse villa à louer à coté de marina smir et du parc pour enfants park smir. le complexe, pieds dans l\'eau, est cloturé et très sécurisé. la villa comprend 3 chambres à coucher doubles , 3 salles de bains, 1 chambre pour la femme de ménage, 1 salle d\'eau pour la femme de ménage, 1 cuisine ouverte sur le salon, 1 salon avec 3 ambiances, 1 porche meublé avec salon d\'été et 1 terrace avec vues sur la mer. la villa est complètement équipée (machine à laver, frigo nouveau, cuisinière, plats, couverts, outils de cuisine, télévision, etc.).', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '104', '104', 'und', '0', 'Un agréable appartement meublé de moyen standing à louer durant une courte et/ou longue période.  situé au lot bayti sakane à hay mohammadi - agadir à 10 minutes du centre ville. l\'appartement, composé essentiellement de 2 chambres, un salon, une cuisine, une salle de bain, et un balcon qui donne sur une vue panoramique (un beau jardin). l\'immeuble se dispose d\'un ascenseur, du parking, de la sécurité. pour toute information contacter moi au 0668562683.', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '105', '105', 'und', '0', 'Ce petit appartement est situé dans le premier resort construit à cabo negro, sans doute le plus original de toute la côte de tétouan. l\'ambiance se trouve à moitié chemin entre un village de pêcheurs et une médina arabe. aucun immeuble ne barre la vue ce qui complète une atmosphère où trouver la relaxation la plus complète. l\'appartement comprend un salon, une chambre à coucher, une salle de bains et une cuisine. la petite terrasse a une vue splendide sur la mer et, au loin, sur les montagnes d\'asla. l\'appartement est parfaitement meublé (cuisine équipée, tv, antenne parabolique, literie, etc.). dans le salon les canapés peuvent devenir 4 lits supplémentaires.', null);
