INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '124', '124', 'und', '0', 'Dans l\'un des quartiers les plus animés à agadir, aux familles j\' offre mon appartement  bien meublé à hay essalam, cette appartement se compose d´un salon et deux chambres,wc, douche,et cuisine bien équipé,\r\nles avantages: climatiseur, chauffage, sèche cheveux , ,parasol, chaises plage, coffre fort numérique, machine à laver, micro onde, grille pain, grillade électrique, cafetière, mixeur,   parking ,  sécurité jour et nuit,... …..etc. \r\n  	\r\n la plage 3 km, port 5 km.la gare routière 2 km,l´aéroport 16 km,souk al ahad 2 km', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '125', '125', 'und', '0', 'loue un luxueux appartement proche de la plage ,dans la belle résidence securisée bella vista ,a cabo negro  très bien meublé ,terrasse donnant sur plusieurs piscines et jardins ,avec vue panoramique sur la mer et la montagne , 2 chambres ,salon tv plasma, satellite , clim, cuisine équipée avec machine a laver micro onde ...salle a manger ,salle de bain.meilleur endroit pour se reposer et respirer de l\'air pur.d\'autres photos sont disponibles sur demande. .tel 00212661167441 , possible de louer courte ou longue duré', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '126', '126', 'und', '0', 'Nous mettons en location courte durée un bel  appartement duplex neuf de 100m²sur cartier gauthier  a cote du consulat d\'italie compose de  deux chambres salon cuisine  deux salles de bain  et  une terrasse le tous  meuble avec gout  il peut accueillir jusqu\'à 6 personnes. la climatisation réversible vous apportera confort. propreté garantie. tarif dégressif selon la durée . a proximité plusieurs commodités: plusieurs restaurants, cafés ,coiffeur, commerce, banque, pâtisserie ,pharmacie ,night club ,les twins center... et à 10min en voiture de la corniche de casablanca au prix de 8400dh semaine .   pour visite et réservation appeler moi au 0661934059', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '127', '127', 'und', '0', 'Imi ouaddar, village de pêcheurs berbères, situé dans la baie d\'agadir entre océan et montagne avec ses plages de sables fin et sa forêt d\'arganiers a su garder une côte pittoresque et sauvage offrant ainsi  un paysage naturel grandiose avec une lumière exceptionnelle, des levers et couchers de soleil  magiques.\r\nadossée à la forêt d\'arganiers se niche notre résidence  de 4 appartements, composé chacun d\'une chambre, d\'une salle d\'eau +wc et  salon/salle à manger, coin cuisine équipée.\r\ndeux d\'entre eux bénéficient  d\'un balcon avec vue sur mer ou sur forêt d\'arganiers\r\nle salon marocain vous offre 2 couchages d\'une place, vous pourrez  y dormir, vous détendre avec la télévision, chaine tnt, et la wifi vous permettra de surfer sur internet si votre «pc portable » vous accompagne.\r\ncette résidence d\'architecture typiquement marocaine possède', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '128', '128', 'und', '0', 'Bienvenue!!! nous avons un trés bel appartement enitèrement meublé (salon tv satellite 2 chambres à coucher, chauffage, eau chaude pour la douche et la cuisine, cuisine toute équipée... ) bien aéré, ensoleillé et trés bien situé( à deux pas du metro et marjane ain sebaa). une résidence trés tranquille (bon voisinage) en face du centre cmmercial de la résidence. situé sur le bord de l\'autoroute pour toutes les destinations . vous n\'aurez vraiment besoin de rien pendant votre séjour chez nous. vous serez vraiment entouré par tout des services. que ce soit pour un passage d\'une nuit ou pour passer vos vacances vous serez les bienvenue. pour réserver ou pour plus d\'informations contactez nous au 0668 48 05 08', null);
INSERT INTO `vam_field_data_field_description` VALUES ('node', 'annonce', '0', '129', '129', 'und', '0', 'Ideal pour les vacance, residence balneair, appartement de 135 m2, comprenant, 2, chambre, salon, grand hall, salle de bain, cours, jardin  et piscine, a 10 minutes a piers de la plage. tel 0033677266480', null);
