INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '44', '44', 'und', '0', 'Description je met en location appartement bien meublé ,grande chambre 1 grand lit ,1 clic clac ,armoire, balcon vue sur mer,un salon,cuisine équipée et terrasse vue imprenable contacter moi au 00212661260771 libre le 28/09', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '85', '85', 'und', '0', 'J\'ai un tres beau appartement meublé a gueliz a proximité de mc donald et zara contient 2 chambres 1 salon cuisine toilette et sdb .l\'appartement est entierement climatisé et se trouve dans un appartement de haut standing.le prix c 600 dhs/nuité.pour reservation ou plus d\'infos contactez 06 66 64 65 27', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '86', '86', 'und', '0', 'J\'ai un tres beau studio meuble a louer climatisé au centre ville contient 1 chambre a coucher 1 grand salon marocain cuisine equipé et sdb.parking au sous sol.contactez moi sur 06 73 54 38 50', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '87', '87', 'und', '0', 'Location villa meublée casablanca maroc (villa saisonnière vacances à 1100 dhs /nuit)', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '88', '88', 'und', '0', 'Je loue mon appartement meublé situé a allal fassi residence tres calme et securisé propre et proche de toutes commodités mosqué snak café et restaurant .l\'appartement contient 2 chambres avec balcon donnant sur le grand boulvard un grand salon climatisé cuisine toute equipée salle de bain et toilette separée.pour reservation ou plus d\'infos contactez moi 06 73 54 38 50', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '89', '89', 'und', '0', 'A marrakech appartement meublé a 400dhs/nuit sur bd hassan 2 a 500 m de la gare du train et a coté de aswak salam , meublé climatisée sécurisée 24/24 dont 2 chambres à couché , cuisine équipée, salon avec tv sat et dvd sdb (ch eau électrique) calme et propre avec parking tel 0666034105', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '90', '90', 'und', '0', 'Loue appartement meublé d\'une superficie de 83m² au quartier belvédère , à 300m de la gare casa voyageur. et proche du centre ville. l\'appartement est composé de 3 pièces. un grand salon , 2 grandes chambres, une cuisine équipée( micro onde, lave linge......) , une salle de bain. contact casablanca: 0613371369 ou 0661797245 contact paris: 0610514959 (minimum 5 jours) 0164779722prix par jour40e/ 400dh. par mois700e/7000dh', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '91', '91', 'und', '0', 'Appartement meublé a louer a 350dh/ la nuit,avec un grand salon lcd sat et 2 chambre a coucher dont une avec terrasse salle de bain chauffe_eau ele et cuisine equipè au quartier charaf prés de marjane route de casablanca.', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '92', '92', 'und', '0', 'L appartement bénéficie d’un emplacement privilégié dans un quartier calme de marrakech, juste en face de l’hypermarché marjane de route de casa , situé au deuxième étage et d’une surface de 55 m2, cet appartement dispose de 1 chambre á coucher  et 2 confortables salons  pouvant ainsi héberger jusqu’à 5 personnes, tv avec lecteur dvd, et chaines étrangéres, cuisine et salle de bain bien équipées, chauffage et climatisation.\r\n15 minutes de promenade vous conduiront jusqu’à la médina, où vous pourrez vous plonger dans l’animation et l’atmosphère unique de ce quartier rempli de souks et d’impressionnants monuments. cet appartement est bien desservi par les transports publics avec un arrêt de bus à marjane et une station de taxis à 50 mètres seulement. la gare de marrakech es á 1Km de l appartement. 350 la nuit et minimum 3 nuits', null);
