INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '136', '136', 'und', '0', 'Je loue a la nuitee studios et appartements tres bien meubles en plein centre villa a gueliz dans des residences recentes et securisdees proche de zara et mc donalds , info et resa 0666981337', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '137', '137', 'und', '0', 'A marrakech appartement meublé a 400dhs/nuit sur bd hassan 2 a 500 m de la gare du train et a coté de aswak salam , meublé climatisée sécurisée 24/24 dont 2 chambres à couché , cuisine équipée, salon avec tv sat et dvd sdb (ch eau électrique) calme et propre avec parking tel 0666034105', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '138', '138', 'und', '0', 'Location pour famille appartement 100 mètres 2 à 10 min de la plage au quartier al wifaq.il dispose de 2 chambres à coucher, salon, cuisine bien équipé, tv sat, salle de bain 250dh/jour', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '139', '139', 'und', '0', 'Dans un complexe balnéaire situé à  5 km du centre guéliz sur la rute de casablance, belle villa meublée, entièrement climatisée, 250 m² , composée de : double salon tv plasma, satellite, 2 chambres dressing + 2 salles de bains, grande cuisine lumuneuse toute équipée,  wc reception. jardin et piscine privative. garage. + une grande piscine collective dans la résidence. sécurisée 24h/24h. loyer :  2000 à 2500 dhs/nuitée seeln saisons ou bien 17000 dhs/mis . contacter : 0655742877', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '140', '140', 'und', '0', 'Près des jardins harti, centre guéliz, un très bel appartement très propre et très bien meublé à l\'eurpéen, 90 m², entièrement climatisé, au 4 ème étage d\'un immeuble neuf, résidence aveec piscine , composé de : salon, séjour, tv plasma satellite, 2 chambtres placards grand balcon commun, cuisine entièrement équipée, wc reception et salle de bains, parking au s/sol. lyer : 700 dhs/ nuitée. contacter : 0655742877', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '141', '141', 'und', '0', 'Guéliz appartement  immeuble neuf , 65 m² à 2 pas d\'acima et jardins majorelle , 4 ème étage composé : 1 salon cheminée 5mx4m tv plasma satelite avec cuisine américaine entièrement  équipée, 1 chambre à coucher 4m x3 m , wc invités et sdb. climatisation. parking au s/sol. loyer : 500 dhs à 600 dhs/nuitée selon saisons et jurs de la semaine. contacter moi au 0655742877', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '142', '142', 'und', '0', 'Bonjour, je vous propose un trés bel appartement entièrement meublé (salon tv satellite 2 chambres à coucher, eau chaude pour la douche, cuisine toute équipée de four, cafetière, machine a laver réfrigérateur, une table avec 4 chaises ,bien aéré, ensoleillé et très bien situé( à deux pas du metro et marjane ain sebaa). une résidence très tranquille (bon voisinage) . vous n\'aurez vraiment besoin de rien pendant votre séjour chez nous. vous serez vraiment entouré par tout les services. pour réserver ou pour plus d\'informations contactez moi au 06 61 55 81 12', null);
INSERT INTO `vam_field_revision_field_description` VALUES ('node', 'annonce', '0', '143', '143', 'und', '0', 'Jolie appartement meublé a louer a mohammedia dans une super quartier el wafa 02chambre sale de bain cuisine séjour salon marocaine 02 télévision avec numérique machine a laver machine de sport frigidaire +internet et wifi ....prix 450dh/nuit 2500dh/semaine . tout les facture inclus. pour réserve et tout information appel moi 0610721978 c est mieux de réserver avant.', null);
